import React from "react";
import { Col, ListGroup } from "react-bootstrap";

const ProfileNavigation = () => {
  return (
    <Col sm={2}>
      <ListGroup className="profile-ul">
        <ListGroup.Item action href="/a-profile">
          Edit Profile
        </ListGroup.Item>
        <ListGroup.Item action href="/a-security">
          Password & Security
        </ListGroup.Item>
        <ListGroup.Item action href="/a-account">
          Account
        </ListGroup.Item>
      </ListGroup>
    </Col>
  );
};

export default ProfileNavigation;
